import React, { Component } from 'react';
import '../../Styles/DinoDoods.css';
import '../../Work.css';

import desktopPrev from '../../../../Assets/Websites/DinoDoods/Previous/PreviousDinoDoods.mp4';
import mobilePrev from '../../../../Assets/Websites/DinoDoods/Previous/ErrorsMobile.mp4';
import ddFigma from '../../../../Assets/Websites/DinoDoods/FigmaDinoDoods.png';

import Fade from 'react-reveal/Fade';

class Two extends Component {
    state = {  } 
    render() { 
        return (
            <div className='whole'>

                <div id = "feedback">
                <Fade><div className='feedbackText'>
                        <p id = "title">Feedback</p>
                        <p id = "paragraph">
                         A lot of main components in the website hindered the branding of the company.
                         It is important to make sure the uniformity of the website did not lose the attraction of our audience.
                        Feedback that was given from the team included: inconsistent color pallete, poor mobile UX design, and
                        lack of performance to excel other companies.
                        </p>
                    </div></Fade>
                    <div className='feedBackImages'>

                       <Fade left><video autoPlay loop className = "smallDesktop" id ="videosFeedback">
                         <source src = {desktopPrev}></source>
                       </video></Fade>

                       <Fade right><video autoPlay loop className="smallPhone" id ="videosFeedback">
                         <source src = {mobilePrev}></source>
                       </video></Fade>


                    </div>
                </div>

                <div className='planning'>
                    <img className = "block col-lg-2" src = {ddFigma}></img>
                    <div className="text block col-lg-5"></div>
                    <p id = "title">Planning</p>
                </div>

            </div>
        );
    }
}

export default Two;
